import React from "react";
import  ReactDOM  from "react";


const rootElement = document.getElementById("root");
const root = createRoot(rootElement);

root.render(
  <StrictMode>
    <App />
  </StrictMode>
);


ReactDOM.render(
<div>
  <h1>Test</h1>
  <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Officia natus non id error dolori</p>
  <ul>
    <li>One</li>
    <li>Two</li>
    <li>Three</li>
  </ul>
</div>
, document.getElementById("root"));
